import React, { Component } from "react";
import ReactDOM from "react-dom";
//import ReactCardCarousel from "react-card-carousel";
import SkillsetCard from "./component/skillset-card";

// Default theme
import '@splidejs/splide/css';

// or other themes
import '@splidejs/splide/css/skyblue';
import '@splidejs/splide/css/sea-green';

// or only core styles
import '@splidejs/splide/css/core';


const styleSkillset = {
  display: "flex",
  flexDirection: "column",
  justifyContent: "center",
  alignItems: "center",

  paddingTop: "100px",
  paddingBottom: "100px"
}

function Skillset() {
  var settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
  };

  return (
    <div style={styleSkillset}>
      <h1 style={{margin : "5px", paddingBottom : "50px"}}>Skillset</h1>

      <div>
        <section class="splide" aria-labelledby="carousel-heading">
          <h2 id="carousel-heading">Basic Structure Example</h2>

          <div class="splide__track">
            <ul class="splide__list">
              <li class="splide__slide"><SkillsetCard /></li>
              <li class="splide__slide"><SkillsetCard /></li>
              <li class="splide__slide"><SkillsetCard /></li>
            </ul>
          </div>
        </section>
      </div>
    </div>
  );
}

export default Skillset;
